import React from 'react'
import Park from './Park'
import './styles.css'

const parks = parksArr.map((park, index) => { 
    return (
      <Park 
        {...park}
        key={index}
      />
    )
  })


const Parks = (props) => { 
    return (
            <li> <Park name={props.name} rating={props.rating}/></li>
    )
}

export default Parks
